    <script>
        jQuery(function($){
            $('path[data-info]').hover(function(e) {
                $('.interactive-map__info-box').css('display', 'block');
                $('.interactive-map__info-box').html($(this).data('info'));
            });

            $('path[data-info]').mouseleave(function(e) {
                $('.interactive-map__info-box').css('display', 'none');
            });

            $('.interactive-map__map').mousemove(function(e){
                let offset = $(this).offset();
                let x = e.pageX- offset.left;
                let y = e.pageY- offset.top + 40;

                $('.interactive-map__info-box').css('transform', 'translate(' + x + 'px, ' + y + 'px)');
            }).mouseover();
        });
    </script>

